import React from "react";
// import Username from "./Username";
// import Age from "./age";
function decimalToHex(number)
{
  if (number < 0)
	number = 0xFFFFFF + number + 1;
	var hex = number.toString(16).toUpperCase();
	var len = hex.length;
	while(len < 6)
	{
		hex = '0'+hex;
		len++;
	}
  return '#'+hex;
}
function	generateColor(i)
{
	// ff99cc pink
	// cc66ff purple
	// 33ccff blue
	var baser, baseg, baseb, r, b, g;
	if(i < 0.5)
	{
		baser = 0xff;
		baseg = 0x99;
		baseb = 0xcc;

		r = baser - parseInt((i) * 102);
		g = baseg - parseInt((i) * 102);
		b = baseb + parseInt((i) * 102);
	}else{
		baser = 0xcc;
		baseg = 0x66;
		baseb = 0xff;

		r = baser - parseInt((i-0.5) * (0xcc-0x33)); //153
		g = baseg + parseInt((i-0.5) * 102);
		b = baseb + parseInt((i-0.5) * 0);
	}
	var rgb = (r<<16) | (g <<8) | b;
	// alert(this.decimalToHex(rgb));
	return(decimalToHex(rgb));
}
class Age extends React.Component
{
	constructor(props){
		super(props);
		this.state = {
			value:this.props.value,
			color:this.props.value.color,
		};
	}
	render(){
		return(
			<div className="info age" style={{backgroundColor:generateColor(this.props.color)}}>
				Age :  {this.state.color}
			</div>
		);
	}
}
